- input: "TEXT\x1CC00440727\x1C1\x1C\x1CF3A\x1CResponding to the request of additional
    information letter dated February 7, 2011.   1. Columns are off because of the
    data entry mistakes made during two reporting cut off cycles. Helpers did not
    realize of the cut off affecting the past reports. Amending the PreGen and the
    Post Gen along with the Year End.   2. Contributions over $200: Two entries totaling
    $80 were entered for the PreGen date range but entered after the report was submitted
    by main Treasurer. Helper did not understand about the cut off dates. Amending
    PreGen to report these 2 entries.   3. 48hr notices: Amer Assoc of Clinical Urologist
    entry is a duplicate.  A entry for URO PAC is the same entry. New helper did not
    research database for the entry and should have known it was reported by main
    Treasurer during the 48hr notice period. Entry has been deleted from database.
    \ A. Pearce was missed. Money was being processed at different offices and helpers
    did not alert the main Treasurer of the $1200 check to be reported. This check
    was mixed in with others that came in that day.  4. 48hr notices: P. Friedmann
    entry was edited by new helper. Check was received on 10/18 and entered by main
    Treasurer. Check is dated 10/5 and helper changed the date not realizing this
    would affect the reports.  We aplogize for these mistakes and have reviewed them
    with the helpers. We will review the database and look for these type of errors
    again before submitting a report.  Thank You to Kendra for helping us through
    these mistakes.   Joyce Schweikert  Treasurer\n"
